func test_fugue512(t *testing.T, input string, wantOutput string) {
	var in, out []byte
	in = []byte(input)
	out = make([]byte, 64)
	Sph_fugue512_process(in[:], out[:], uint(len(in)))
	want, _ := hex.DecodeString(wantOutput)
	//fmt.Printf(" inTxt: %s\noutput: %x \n", in, out)
	assert.Equal(t, want, out)
}

func test_fugue512_hexInput(t *testing.T, hexInput string, wantOutput string) {
	var in, out []byte
	in, _ = hex.DecodeString(hexInput)
	out = make([]byte, 64)
	Sph_fugue512_process(in[:], out[:], uint(len(in)))
	want, _ := hex.DecodeString(wantOutput)
	//fmt.Printf(" inHex: %x\noutput: %x \n", in, out)
	assert.Equal(t, want, out)
}
